import React from 'react';



class DarkMode extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			lightMode: "light"
		}
	}

	hitLights = () => {
		document.body.style.backgroundColor = "red";
	}

	render () {
		return (
		<div onclick={this.hitLights}>DARK MODE</div>
		)
	}

};

export default DarkMode;
